import React from "react";
import "./css-components/slide-show.css";

function SlideShow() {
  return (
    <div class="slider">
      <a href="#slide-1">1</a>
      <a href="#slide-2">2</a>

      <div class="slides">
        <div id="slide-1">1</div>
        <div id="slide-2">2</div>
      </div>
    </div>
  );
}

export default SlideShow;
